('Error:111', 'The bulb lights up during the daytime, possibly due to a faulty light sensor or incorrect wiring.', 'Replace the bulb and verify the wiring and sensor functionality.', 1, '2025-04-07 23:47:06', '2025-04-07 23:47:06'),
('Error:212', 'The bulb isn\'t working at night; during nighttime, both current and voltage are zero.', 'Check if the bulb is functional. Inspect the sensors and battery power to ensure they are in good condition.', 1, '2025-04-07 23:46:55', '2025-04-07 23:46:55'),
('Error:300', 'Discharge very quickly during night time.', 'Check the battery if still in a good condition if not then replace with a good condition battery.', 1, '2025-04-07 23:49:10', '2025-04-07 23:49:10'),
('Error:305', 'The sudden jumps or down of soc values on every hour.', 'Recalibrate the current sensor or replace it if necessary.', 1, '2025-04-07 23:48:06', '2025-04-07 23:48:06'),
('Error:306', 'The consecutive 3 days has idle trends in zero of soc during night time.', 'Check if the area has still good internet connectivity, check the gsm if still working or have a load data, check the microcontroller if still work properly and check the battery if still present.', 1, '2025-04-07 23:48:17', '2025-04-07 23:48:17'),
('Error:308', 'The consecutive 3 days has idle trends in 100% of soc during night time.', 'Check if the bulb is still working or present if not then replace the bulb.', 1, '2025-04-07 23:48:40', '2025-04-07 23:48:40'),
('Error:311', 'The solar panel connection might be loose or damaged, causing improper charging.', 'Check the current sensor and charge controller for possible issues.', 1, '2025-04-07 23:47:17', '2025-04-07 23:47:17'),
('Error:312', 'For three consecutive days, daytime data shows a drop in power, indicating a possible solar panel issue.', 'Replace the bulb or consider changing the solar panel if necessary.', 1, '2025-04-07 23:47:30', '2025-04-07 23:47:30'),
('Error:313', 'For three consecutive days, daytime data shows irregular power readings, suggesting a potential sensor malfunction.', 'Replace the bulb and inspect the charge controller for faults.', 1, '2025-04-07 23:47:43', '2025-04-07 23:47:43'),
('Error:314', 'The battery reaches full charge in just 2 hours, which may indicate overcharging or a faulty charge controller.', 'Check the charge controller to ensure it is regulating the charging process correctly.', 1, '2025-04-07 23:47:55', '2025-04-07 23:47:55'),
('Error:317', 'The consecutive 3 days has idle trends in zero of soc during day time.', 'Check if the area has still good internet connectivity, check the gsm if still working or have a load data, check the microcontroller if still work properly and check the battery if still present.', 1, '2025-04-07 23:48:28', '2025-04-07 23:48:28'),
('Error:319', 'The consecutive 3 days has idle trends in 100% of soc during day time.', 'Check if the bulb is still working or present if not then replace the bulb.', 1, '2025-04-07 23:48:55', '2025-04-07 23:48:55'),
('Error:400', 'No present data of all components', 'Needs overall \'trouble shoot or \'check the microcontroller if still working.', 1, '2025-04-07 23:49:22', '2025-04-07 23:49:22');
